import React, { Component } from 'react';
import '../assets/SCSS/home1.scss'; // Import the SCSS file

class Home extends Component {
  render() {
    return (
      <div className="align-center">
        <h2 className="text-center">Welcome to Mons Pet</h2>
        <div className="img">
          <img
            src="https://monspet.com/wp-content/uploads/2019/07/uploads2Fcard2Fimage2F4581502F31d70745-4fbb-4630-a27d-cc0591c780b7.jpg2F950x534__filters3Aquality288029-768x432.jpg"
            alt="Welcome Image"
            className="welcome-image"
          />
        </div>
      </div>
    );
  }
}

export default Home;
